    constructor(){
        super()
        this.state={
            tution:[]
        }
    }

    componentDidMount() {
        fetch(`http://localhost:4000/tutiondisplay`, {
            method: 'get',
            headers: new Headers({ 'Content-Type': 'applications/json', 'authorization': localStorage.getItem('tok') })
        })

            .then(response => response.json())
            .then(data => {
                this.setState({
                    tution: data

                })

            })

        if (localStorage.getItem('tok') !== 'undefined' &&
            localStorage.getItem('tok') &&
            localStorage.getItem('type') == 'finder') {

        }
        else {
            this.props.history.push('/')
        }
    }

    render(){
        return(
            <div>
                <NavBar />
               <Link><Button className="btn-success" style={{fontWeight:"bold",position:"absolute",right:150,height:40}}><span className="glyphicon glyphicon-plus"></span>New Tution</Button></Link>
            {this.state.tution.map(arr=>{
                return(
                <li key={arr.tution_id}>{arr.studentname}</li>
                )
            })}
            </div>
        )
    }
}

export default tutiondisplay
